package main

import (
	"fmt"
	"math"
	"time"
)

func d(s string, i interface{}) {
	fmt.Printf("%s: %+v\n", s, i)
}

func mostCompetitive(nums []int, k int) []int {
	subs := make([]int, k)
	L := len(nums)
	d("k", k)
	d("L", L)
	if k == L {
		return nums
	}

	i := -1
	n := k
	m := i
	d("L", L)

	for {
		min := int(math.Pow10(9))
		for j := L - n; j > i; j-- {
			if nums[j] <= min {
				m = j
				min = nums[j]
			}
		}

		d("i", i)
		d("m", m)
		d("min", min)

		subs[k-n] = min
		i = m
		n--
		if n == 0 {
			break
		}

		time.Sleep(2 * time.Second)
	}

	return subs
}

